/*
腾讯地图地行政区划v20230704
level为1和2级别带拼音
共有1级34个，2级492个，3级3093个

行政区划代码（adcode）规则说明
代码共6位，前两位代表省（一级）、中间两位为市/地区（二级），最后两位为区县（三级）
  省级：前两位有值，后4位置0，如，河北省：130000
  市/地区：前4四位有值，包含省代码与市代码，最后两位置0，如河北省保定市：130600
  区县：6位全有值，包含前4位省市代码及区县代码，河北省保定市涿州市：130681
直辖市、香港、澳门：
  同省级，其下直接为区级（没有二级结构填充）
  例：北京,东城区 （而非：“北京,北京,东城区”）
直辖县：第3、4位为90的，为省直辖县
东莞市、中山市、儋州市、嘉峪关市 因其下无区县级，因此增加了末位为99代码的同名子级，用于补齐到三级区划的结构

如何获取城市编码（city_code）：
1）编码前4位不为0，第5、6位为0的，为常规城市，可直接取用
2）北京、上海、重庆、天津、香港、澳门，编码和省一致，需要单独提出
3）第3、4位为90的为省直辖县，一般当做城市来应用，也需要单独提出
*/

CREATE TABLE `qmap_district` (
  `id` varchar(6) NOT NULL COMMENT '行政编码adcode',
  `pid` varchar(6) NOT NULL DEFAULT '0' COMMENT '所属上级adcode',
  `level` tinyint NOT NULL DEFAULT '0' COMMENT '区域等级',
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '区域名称',
  `pinyin` varchar(20) NOT NULL DEFAULT '' COMMENT '拼音',
  `lng` decimal(10,6) NOT NULL DEFAULT '0.000000' COMMENT '经度',
  `lat` decimal(10,6) NOT NULL DEFAULT '0.000000' COMMENT '纬度',
  PRIMARY KEY (`id`),
  KEY `pid` (`pid`)
) COMMENT='腾讯地图行政区划v20230704';

